const PrescModal = () =>{
    return(
        <div className="PrescModalbox">
            <div className="boxHeader">
                <h3 id="boxHeader">처방 상태 변경</h3>
            </div>
                            <div id="presX" style={{width:"140px"}}>미투약</div><br/>
                            <div id="presO"  style={{width:"140px"}}>정상 투약</div><br/>
                            <div id="presXV"  style={{width:"140px"}}>투약 X - 반환 가능</div><br/>
                            <div id="presXVX"  style={{width:"140px"}}>투약 X - 반환 불가</div>
                            <br/>
                            <button id="button1">저장</button>
                </div>
    )
}

export default PrescModal;
